import React from 'react';
import Project from './Project';

function Ncard (val){
    return (
   
    <Card 
        key={val.id} 
            src={val.src}
            title={val.title}
            details={val.details}
            link={val.link}
         />
       );
}


const Reactproject = () => {
    return (
        <>
 
        {Sdata.map(Ncard)}
            </>
    );
}

export default Reactproject;
